import React from "react";

export default function PiData(props){
    let cpu = props.cpu;
    let gpu = props.gpu;
    let ram = props.ram;
    console.log(cpu)
    function getCPUData(){
        return(
            <div>
                CPU Data
            </div>
        )
    };

    function getMemoryData(){
        return(
            <div>
                Memory Data
            </div>
        )
    };

    function getOtherData(){
        return(
            <div>
                Other Data
            </div>
        )
    };

    return(
        <div>
            <div>
                <h2> { cpu } </h2>
            </div>
            <div>
                <h2> { gpu } </h2>
            </div>
            <div>
                <h2> { ram } </h2>
            </div>
        </div>
    )
};
